import React, { useState } from 'react'

function Wishlist() {
    const [items, setItems] = useState([]);

    useEffect(() => {
        const wishlistItem = JSON.parse(localStorage.getItem('wishlist'));
        if (wishlistItem) {
            setItems(wishlistItem);
        }
    }, []);
    console.log(items);


    return (
        <div>Wishlist</div>
    )
}

export default Wishlist
